# test_server.py
import requests
import base64
import json

# --- PASTE YOUR BASE64 STRINGS HERE ---
# Replace '...' with the long string you copied for the pothole image
POTHOLE_IMAGE_B64 = "" 

# Replace '...' with the long string you copied for the bench image
BENCH_IMAGE_B64 = ""

def test_server():
    server_url = "http://localhost:8000"
    
    # Test health endpoint
    try:
        response = requests.get(f"{server_url}/health")
        print(" Health check:", response.json())
    except Exception as e:
        print(" Health check failed:", e)
        return

    test_cases = [
        {
            "description": "pothole on the road",
            "image": POTHOLE_IMAGE_B64,
            "expected": " Should PASS - Real pothole image"
        },
        {
            "description": "broken park bench",
            "image": BENCH_IMAGE_B64,
            "expected": " Should PASS - Real bench image"
        },
        {
            "description": "a beautiful cat",
            "image": POTHOLE_IMAGE_B64, # Using the wrong image on purpose
            "expected": " Should FAIL - Mismatched description and image"
        }
    ]
    
    print("\n" + "="*80)
    print("TESTING MUNICIPAL AUTHORITY DETECTION WITH REAL IMAGES")
    print("="*80)
    
    for i, test_case in enumerate(test_cases, 1):
        print(f"\n Test {i}: {test_case['expected']}")
        print(f"Description: '{test_case['description']}'")
        
        test_data = {
            "image": test_case['image'],
            "description": test_case['description']
        }
        
        try:
            response = requests.post(
                f"{server_url}/analyze",
                headers={"Content-Type": "application/json"},
                json=test_data
            )
            result = response.json()
            
            if response.status_code == 200 and result.get('success'):
                print(f" RESULT: SUCCESS")
                print(f" Message: {result['message']}")
                print(f" Message: {result['category']}")
            else:
                print(f" RESULT: REJECTED")
                print(f" Reason: {result.get('message', 'No message provided.')}")
                
        except Exception as e:
            print(f" ERROR: {e}")
        
        print("-" * 60)

if __name__ == "__main__":
    test_server()